import classes from './Post.module.css';

export const Post = () => {
    return (
        <div className={classes.item}>
            <img src="http://c.files.bbci.co.uk/17B2C/production/_117586079_avatar_getty.jpg" alt='avatar'/>
            <div>
                Post 1
                <div>
                    <span>Like</span>
                </div>
            </div>
        </div>
    )
}
